import React from 'react'
import { Box, Container, Typography } from '@mui/material'
import CircularProgress from '@mui/material/CircularProgress';
function Loading() {
    return (
            <Box sx={{height:'200px', width: '40%', bgcolor: 'rgba(0, 0, 0, 0.9)', m:"auto", my:'15%',borderRadius:2,pb:10 }}>
                <Box sx={{width:'40%', m:"auto", pt:"60px"}} >
                    <Typography variant="h6" sx={{ display: {xs:"none", md:"block"}, color : "white"}}>Loading For Data ...</Typography>
                    <CircularProgress color="secondary" sx={{ ml : "20px", mt:2}} />
                </Box>
            </Box>
    )
}

export default Loading
